import React from 'react';
import Typography from '@material-ui/core/Typography';

import Login from 'components/Login/Login';

import './Home.scss';

function Home() {
  return (
    <div>
      <Typography variant="h1" component="h1" gutterBottom>
        Dan's Diet
      </Typography>
      <Login />
    </div>
  )
}

export default Home;
